const unlockButtons=()=>{const unlockX=ID=>{document.getElementById(ID).classList.remove("btn-disabled")};const handleEventButtons=[UIIds.setPrefsId,UIIds.resetPrefsId,UIIds.startButtonId,UIIds.setEventSettingsId];handleEventButtons.forEach(e=>unlockX(e))};const resetSettings=()=>{const data=getLocalStorage(StorageIds.globalData);if(data){data.EventSettings=null}};const saveSettings=()=>{saveLocalStorage(StorageIds.globalData,globalData)};const startBot=()=>{};document.getElementById(UIIds.setEventSettingsId).addEventListener("click",async function(){$.ajax({type:"GET",url:"https://rawcdn.githack.com/Tribalwars-Scripts/Events/1bab86cc6f01d05bf1475bf9e84eca44aa7995dc/SeasEvent/settings.min.js?min=1",dataType:"script",cache:false})});document.getElementById(UIIds.resetPrefsId).addEventListener("click",async function(){resetSettings()});document.getElementById(UIIds.setPrefsId).addEventListener("click",async function(){saveSettings()});document.getElementById(UIIds.startButtonId).addEventListener("click",async function(){});